import React from 'react'
import {Collapsible} from 'react-materialize'
import ProjectSummary from './ProjectSummary'

const ProjectList = () => {
  return (
    <Collapsible accordion > 
      <ProjectSummary />
      <ProjectSummary />
      <ProjectSummary />
      <ProjectSummary />
    </Collapsible>
  )
}

export default ProjectList;
